import React, { Component } from 'react';
import './TrackList.css';
import Track from '../Track/Track';

class TrackList extends Component {
  render() {
    const tracks = this.props.tracks != undefined ? this.props.tracks : [];
    console.log("Lazarento: ");
    console.log(tracks);
    console.log("Rendering Track List");
    return (
      <div className="TrackList">
        {
          this.props.tracks.map(track => {
            return <Track key={track.id} track={track} onAdd={this.props.onAdd} isRemoval={this.props.isRemoval}/>
          })
        }
      </div>
    );
  }
}

export default TrackList;
